import { BrowserRouter, Routes, Route } from "react-router-dom";
import Navbar from './Components/Navbar';
import Footer from './Components/Footer';
import Content from './Components/Content';

const app = {
  minHeight: '100vh',
  backgroundColor: 'wheat'
}

function App() {
  return (
    <><>
    <div style={app}>
      <Navbar />
      <Content />
      <Footer />
    </div>
    </>
    </>
  );
}

export default App;
